import React from 'react';
import perfil from 'D:\\Documentos\\OCTAVO SEMESTRE\\MicafeUmes2.0\\front-end\\front_end/src/assets/carrito.png';
import carrito from 'D:\\Documentos\\OCTAVO SEMESTRE\\MicafeUmes2.0\\front-end\\front_end/src/assets/perfil.png';
export const Rome = () => {
  return (
    <div>
      <nav className="navbar">

        <div className="nav-links">
          <div className="left-links">
            <a href="#">Mis compras</a>
          </div>
          <div className="right-links">
          <img src={carrito} alt="carrito" />
          <img src={perfil} alt="perfil" />
          </div>
        </div>
      </nav>
      <div className="container mt-5 container-with-green-background">
        <h1>Bienvenido a la cafeteria Rome</h1>
      </div>
      <div className="product-section">
        <h2>Nuestros Productos</h2>
        {/* Agregar lista de productos aqu√≠ */}
      </div>
    </div>
  );
}
